script:
reset();

const door = false;
const type = door ? 2 : 1;

const size = { x: 32, y: 64, z: 16 };
const origin = { x: size.x * -0.5, z: size.z * -0.5 };
const walls = 12;
const noise = new SimplexNoise('SuperSeed');

box(origin.x - 1, 0, origin.z - size.z - 1, size.x + 2, walls, size.z * 2 + 2, 2);
for (let i = 0; i < 2; i += 1) {
  const z = origin.z + i * (-size.z);
  box(origin.x, 0, z, size.x, walls, size.z, type);
  box(origin.x + 1, 1, z + 1, size.x - 2, walls, size.z - 2, 0);
}

box(origin.x + size.x * 0.5 - 2, 1, origin.z - 1, 4, walls * 0.5 - 1, 2, 0);
if (door) {
  box(origin.x + size.x * 0.5 - 1, 1, origin.z, 2, walls * 0.5 - 1, 1, 1);
}

box(origin.x + 1, walls * 0.5 + 1, origin.z - size.z + 4, size.x - 2, 1, 2, type);

const elevator = {
  x: origin.x + 13,
  y: 0,
  z: origin.z + size.z,
};

box(
  elevator.x, elevator.y, elevator.z,
  6, 7, 6,
  2
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  4, 5, 4,
  0
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z - 2,
  4, 5, 1,
  type
);
box(
  elevator.x + 2, elevator.y + 1, elevator.z - 2,
  2, 4, 3,
  0
);
